import React from 'react';

const Leaderboard = () => {
  return (
    <div className="leaderboard">
      <h2>Leaderboard</h2>
      <div className="leaderboard-content">
        <p>Leaderboard coming soon!</p>
      </div>
    </div>
  );
};

export default Leaderboard;
